script: |
  super -f tsv -I q12832.sql | sort > q12832.out

vector: true

inputs:
  - name: q12832.sql
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab0 AS cor0 WHERE + col1 * + ( - col0 ) NOT BETWEEN ( col1 + + col2 ) AND NULL;
  - name: tab0

outputs:
  - name: q12832.out
    data: |
      10
      47
      99
